  selector: 'app-add-game',
  templateUrl: './add-game.component.html',
  styleUrls: ['./add-game.component.css']
})
export class AddGameComponent implements OnInit {

  addGameRequest: Game = {
    id: '',
    name: '',
    description: '',
    platform: '',
    imgurl: ''
  }
  constructor(private games) { }

  ngOnInit() : void {
  }

